import {
  View,
  StyleSheet,
  Text,
  FlatList,
  TouchableOpacity,
  Image,
} from "react-native";


export default class ForHireScreen extends Component {


  render() {
    return (
      <View>
<Text>For Hire screen</Text>
      </View>
    );
  }
}
